import reclass Solution:    def threeSum(self, nums):        sort_list = sorted(nums)        if len(sort_list) < 3:            return []        three_list = {}        for i in range(len(sort_list)):            for j in range(i + 1, len(sort_list)):                two_sum = [sort_list[i]] + [sort_list[j]]                for k in range(j+1,len(sort_list)):                    if sum(two_sum) + sort_list[k] == 0:                             three_list['{}'.format(two_sum+[sort_list[k]])] = 1        return  self.result(three_list)    def result(self,three_list):        list_ = []        for i  in  map(eval, list(three_list.keys())):            list_.append(i)        return  list_print(Solution().threeSum([]))print(re.search('123(.+)123','123456123').group(1))